def primarypoll():
    while True:
        try:
            ops = java.fetchOps()
            for op in ops:
                if op.revision == -1 and op.param2 != None:
                    java.globalRev = int(op.param2.split("\x1e")[0])
                if op.revision == -1 and op.param1 != None:
                    java.individualRev = int(op.param1.split("\x1e")[0])
                java.localRev = max(op.revision, java.localRev)
        except Exception as e:
            print(e)

Thread(target=primarypoll).start()

def run():
    while True:
        try:
#           delExpire()
            ops = noobcoderPoll.singleTrace(count=50)
            if ops != None:
                for op in ops:
                   loop.run_until_complete(noobcoderBot(op))
                   #noobcoderBot(op)
                   noobcoderPoll.setRevision(op.revision)
        except Exception as e:
            logError(e)
            
if __name__ == "__main__":
    run()
